import React from 'react'

function ChartComponent({ ts, status, value }) {
    return (
        <>
            <div className="row" style={{ letterSpacing: '-5px' }} >
                if(status==1){
                    <p style={{ color: 'green' }}>|</p>
                }
                else if(status==0){
                    <p style={{ color: 'yellow' }}>|</p>
                }
                else{
                    <p style={{ color: 'red' }}>|</p>
                }
            </div>


        </>
    )
}

export default ChartComponent
